const img1 = "https://picsum.photos/200/100";
const img2 = "https://picsum.photos/id/237/200/100";
const img3 = "https://picsum.photos/seed/picsum/200/100";
const img4 = "https://picsum.photos/200/100?grayscale";
const img5 = "https://picsum.photos/200/100/?blur";
const img6 = "https://picsum.photos/200/100/?blur=2";

const Sdata = [
    {
    imgsrc: img1,
    title: "SK Technical",
    },
    {
    imgsrc: img2,
    title: "Fun Land",
    },
    {
    imgsrc: img3,
    title: "Sk Compeney",
    },
    {
    imgsrc: img4,
    title: "Amazing Photo",
    },
    {
    imgsrc: img5,
    title: "Webkit photo",
    },
    {
    imgsrc: img6,
    title: "Webkit photo",
    },
];

export default Sdata;
